    "details" : "The name ʾAdal first appeared in the historical record at the end of the 13th century. It was first under the authonomy of the Muslim sultanate of ʾIfāt. However, in the decades after 1288 ʾAdal must have regained its sovereignity which continued to 1415. Soon after 1415, however, ʾAdal must again have become subordinate to ʾIfāt.",
