    "place_types" : [ "city", "port", "Aksumite" ],
    "details" : "ʾAdulis was the main port of ʾAksum during the zenith of the Aksumite Empire. This port is mentioned in numerous foreign reports and played a key role in maintaining trade contacts with other powers of the time. The city probably lay some distance (20 stades) from the actual port. According to Pliny, it was a large centre of trade founded by slaves from Egypt who run away from their masters. The trade of ʾAdulis with other centres is recounted by the Periplus of the Erythraean Sea, which reports lists of imports and exports. Cosmas Indicopleustes offers maps that illustrate some characteristics of ʾAdulis. Research has shown that ʾAdulis was a sizeable town and archeological excavations have found traces of an ancient prehistoric settlement beneath the Aksumite town. How ʾAdulis was destroyed is not certain yet. It was traditionally claimed that it was destroyed by an Arab expedition in 640 AD however, while traces of fire were found, the expedition was said to be a failure.",
