    "details" : "The church of ʾAksum Ṣǝyon has a long and complex history of destructions and reconstructions with a number of legendary aspects. It has a key role in Ethiopia's cultural heritage and is referred to in a number of sources: Mäṣḥafä Aksum, Francisco Alvares's account (ca. 1520), Gadla Libānos (1400), Iter de Venetiis ad Indiam (1400), etc. Although the remains of ancient structures were identified under or embedded in today's church, the early history of this church is hard to reconstruct and involved legendary figures such as ʾAbrǝhā and ʾAṣbǝḥa and queen Gudit. Gadla Libānos refers that ʾaṣe Dāwit I ordered the church restored in 1406. The possessions of the church grew significantly over time and Mäṣḥafä Aksum records a number of land grants to the church. ʾAksum Ṣǝyon was destroyed in 1535 by ʾAḥmad and then rebuilt by ʾaṣe Śarḍa Dǝngǝl in the second half of the 16th cent. According to a Jesuit annual letter, it was burned down by the Oromo in 1611 but it was probably quickly restored as the church was visited and described by Manoel de Almeida , Tomás Barreto and Manoel Barradas in the 1620s - early 1630s. The church was restored in 1655 by ʾaṣe Fāsiladas and again in 1749-50 by ʾaṣe ʾIyāsu II. Following this last restoration the church has remained the same, except for some 19th-20th cent. alterations, while the surrounding buildings have experienced radical changes including the new round church of Māryām Ṣǝyon built by ʾaṣe Ḫaylä Śǝllase I next to the old one.",
