    "provenance" : "Encyclopedia Aethiopica",
    "place_types" : "town",
    "details" : "ʾAzazo is a town located 13 km ca. southwest of the historic city of Gondar. During the 17th century, it became a major religious and political centre and it remained a royal residence and a residence of the ʾǝč̣č̣age for much of the 18th and 19th century. Under ʾaṣe Susǝnyos it became an important residence for both the Emperor and the Jesuits. It remained the seat of the ʾǝč̣č̣age until the 19th century, even after the establishment of the quarter of ʾƎč̣č̣age Bet in Gondar. ʾAzazo was the place where the monastery of Dabra Libānos was relocated from the Šawā (cfr. ʾAzazo Takla Hāymānot).",
