    "details" : "ʾAzazo Takla Hāymānot is one of the so-called 44 churches of Gondar. It is located in the town of ʾAzazo, 13 km southwest of Gondar. This church played an important role in the history of Ethiopian monasticism: following the burning of Dabra Libānos in 1532 and the decision to move the monastic community north in the lake Ṭānā area, the monastic community of Dabra Libānos finally settled in ʾAzazo.",
