    "place_types" : [ "region", " Postaksumite II" ],
    "details" : "The medieval state of Bāle was bordered by the medieval Muslim states of Dawro and Särka in the north, Hadiyya in the west , Adäl and Dawro in the east and huge grazing ground of the Oromo pastoralist in the south. It came to existence as a Muslim state in the 11th and 13th centuries. The history of the Muslim state of Bāle linked to the history of Ḥusayn , the great early 13th century standard bearer of Islam in Bāle. The Muslim states of Bāle was famous for its cotton cloth weaving industry, and its foreign traders, including Arabs and Persians. Like other Muslim states of the southern Ethiopia, Bāle was conquered by ʿAmda Ṣǝyon I in the fourteenth century and became part of the Christian kingdom of Ethiopia. Of all Muslim states of southern Ethiopia, it was Bāle that seems to have shaped the course of the early histroy Oromo. Historical Bāle was the original home of primeval Oromo groups that were engaged in a mixed economy.",
