    "provenance" : "Encyclopedia Aethiopica",
    "place_types" : "church",
    "details" : "Dabra Bǝrhān Śǝllāse was an influential church situated on an elevated land north-west of Gondar and consecrated in 1694 during the reign of ʾaṣe ʾIyāsu I. The original establishment included 170 clergy and generous land grants. In this church the emperor and his court celebrated the Feast of the Trinity. The church was destroyed by lightning in 1707 but immediately rebuilt. Probably between 1800 and 1830, it was replaced by the current rectangular building which survived the attack of Gondar by the dervishes in 1888.",
