    "place_types" : "town",
    "details" : "The town of Gondar is located in today's Samen Gondar Zone (historically Bägemdǝr province) in the ʾAmharā kǝllǝl Regional State. Gondar started to flourish after ʾaṣe Fāsiladas chose it as his camp in 1636-'37 to control the collection of customs on the Red Sea - Ṭānā - Ǝnnarya trade routes. Following its foundation and for approx. 130 years (from 1630s to 1760s), Gondar was the political, religious, cultural and intellectual capital of the Gondarine Kingdom. Its founder Fāsiladas built the first nucleus of the town including his castle, some churches and his pleasure pool. After him, his son ʾaṣe Yoḥannǝs I and grandson ʾaṣe ʾIyāsu I chose to remain in Gondar and built their own castles and churches. So by the late 17th century, Gondar had become a permanent and sizeable settlement where Ethiopian rulers resided when not campaigning and where the highest commerical, political and religious classes gathered around the throne. In the 17th century Gondar also became the major commercial centre of northern Ethiopia. During the 18th century, the royal compound was completed with the construction of castles by Dāwit III, Bakāffā and ʾIyāsu II, the church of ʾAṣṣāṣāme Qǝddus Mikāʾel by Dāwit III and various subsidiary buildings (the whole surrounded by a double wall with twelve gates and reinforcing towers). However, by the late 18th century, no more castles were built and, from the 19th century, Gondar gradually lost its political power and shrank in size while the centre of the power moved to Šawā. Tewodros II set his capital in Däbrä Tabor and, in 1866 attacked, burnt and looted Gondar. Finally, in 1888 and 1889, the Mahdists attacked and burnt down what was left of the city which saw some redevelopment only in the 1920s . During the Italian occupation, Gondar became the capital of the Governo dell'Amhara (one of six governorates forming the Africa Orientale Italiana), it was restructured and rebuilt along modernist lines and its population increased significantly. After the defeat of the Italians in 1941, Gondar became the capital of the Province of Bägemdǝr and Sǝmen, flourished and grew in population becoming a major commercial and cultural centre.",
