    "details" : "It was a historical region and sultanate in centralEthiopia, flourished around 1285. It is an integral part of the Rift Valley, the area of ʾIfāt served for millenia as a point of contact between the pastoral or nomadic economic formations of the eastern lowlands and ancient agricultural societies of the Ethiopian highlands. Islam must have been introduced into the region in early times. The growth of the power of ʾIfāt came to a halt in the 14th century. The strategic importance of ʾIfāt placed it against the Christian state consolidated by the rulers of Solomonic dynasty, whose ambition was to control the caravan trade to theRed Sea Indian Ocean. The area of ʾIfāt was reduced to a battle ground in the course of ʾAḥmad and subsequentOromomigrations. In the 16th and 18th century ʾIfāt remained a small region betweenRobiand Qäbänna rivers. ʾIfāt had won important value in the study of historical geography both in the local works and traveler accounts. The Tārika ʿĀmda Ṣǝyon recounted the campaign of the king against the Sultanate of ʾIfāt. The entire chronicle is devoted of the warrior’s king against the Sultan of ʾIfāt Ṣabraddīn I Muḥammad b. Dalḥūy . It also appears in Chronicle of Zarʾa Yāʿǝqobwhich reports that the king appointed a governor for the province of ʾIfāt.",
