    "place_types" : [ "town", "<span class=\"label label-warning\">More then 1 ZaMa MoPe</span>" ],
    "details" : "Maala probably evolved from a 13th-century hamlet called Ǝnda Mäsqäl (later Ǝnda Mädḫane ʿAläm). It became a town by the early 19th century. Maala grew into a regional centre under Kaśā Mǝrč̣ā who chose it for strategic reasons, both commercial (it was located along important trade routes) and political (it was located on the route to Šawā). Maala became an important market town and, in the 1880s, the emperor's capital city. However, with the succession of Mǝnilǝk II , the political and commercial balance shifted to southern Ethiopia in favour of Šawā and ʾAddis ʾAbabā. In 1895, Maala was occcupied by the Italians and became part of the Colonia Eritrea, but Mǝnilǝk II reconquered it in Januar 1896. Maala urbanized progressively during the 20th century and three particularly important moments can be identified. Under daǧǧāzmāč Abrǝha Arʾaya Dǝmṣu , new buildings were built, a new Saturday Market was established and variousoccupational groups were attracked to the town. In the 1920s and 1930s, the town witnessed an increase in trade activity and modernization of the infrastructure, also thanks to the Italian occupation. In spite of the damages caused by the British air bombardments in September-October 1943, the third wave of urbanization took place between 1942 and 1974, including the development of infrastructure, services, commercial activities and administration. The 1974-1991 war seriously hindered the urbanization process but, after 1991, it has resumed at a great pace. Maala is today the capital of Bǝḥerāwi Kǝllǝlāwi Mangǝśti Tǝgrāy.",
