    "place_types" : "church",
    "details" : "The church of Nārgā Śǝllāse is located on the islet of Narga, east of Däq island in the middle of lake Ṭānā. It was founded in 1737/'38 by ʾǝtege Bǝrhān Mogasā and this event is described in the Zena Narga. The construction of the entire complex took up to 1750 and the church was endowed by Bǝrhān Mogasā and her son ʾIyāsu II with books and liturgical objects. The church was partially restored in the 1950s under Ḫaylä Śǝllase I .",
