    "place_types" : [ "province", " Postaksumite II" ],
    "details" : "Šawā was the name of several polities on the territory of Ethiopia. In Ethiopian Christian sources, Šawā appears only in the 14th century and early reference to Šawā are two fold. In the early time, it was the name of a medieval Islamic sultanate; later the name of the province of the Christian empire. In the medieval Christian sources, Šawā is represented as area situated to the south of the chain of the districts consitituting the historical Amharā including Angot,Gayǝnt, Gǝšše as well as Wäläqaand Märḥabete, came under the firm control of the Chrisitian monarchs in the 14th century, following the victories of ʾaṣe ʿAmda Ṣǝyon I. In the west, Šawā neigboured with Dāmotin the south and souteast, the chain of the Muslim Sultanates of which ʾIfāt was the strongest. The presence of numerous rock-cut and cave churches is a conspicuous feature of Šawā's early Salomonic period, clearly showing the regions's importance and cultural and political affiliation. In the late 15th century -16 th century several locations in Šawā appear to have been important sites of the royal moving capitals. After ǧihad the importance of Šawā was re-established for a while. In the 17th century Šawā was de facto separated from Gondarine kingdom. Thus, in the 18th-19th century, the name Šawā was applied to the kingdom of Šawā, which later became again the name of the administrative unit within the unified Empire.",
