    "place_types" : [ "region", " Postaksumite II" ],
    "details" : "Waǧ is a historical region in Šawāsouth of the river Mugär which flows into the ʾAbbāy west of Dabra Libānos of Šawā. It was one of the seven districts of Šawā which contributed to troops to Yǝkunno ʾAmlāk for his campaign against the last Zāgʷe king. It was also the native region of Yǝmrǝḥanna Krǝstos the 15th century 9th ʾǝč̣č̣age of Dabra Libānos. The history of Waǧ is closely connected to its neigbour on the eastFaṭagār. ʿAmda Ṣǝyon I is reported to have defeated the Zebdār of Waǧ and appointed a governor with the title Masfǝn. During the time of ʾaṣe Zarʾa Yāʿǝqob the governor bore the title hǝgāno, a possible indication that the district was Islamic by that time. During the time of ʾaṣe Baʾǝda Māryām I it was served as an important startegic region to conduct a military campaigns against ʾAdāl. Following the death of ʾAḥmad, Waǧ was also a stronghold of King ʾaṣe Galāwdewos where he built his royal seat in1550. In 1577, ʾaṣe Śarḍa Dǝngǝl, on his way to attack sultān of ʾAdāl, passed through Waǧ.",
