    "details" : "Wagarā is a district north of Ṭānā and south west of Sǝmen, inhabited mostly by the Agäw. It was one of the provinces in which Lǝbna Dǝngǝl sought refuge during the Muslim wars of the sixteenth century. After Lǝbna Dǝngǝl was defeated in the mid 1530s, Wagarā became the stronghold of the Muslim leaderʾAḥmad until he was defeated and killed by King ʾaṣe Galāwdewos forces in 1543. Minās and Säblä Dǝngǝl used Wagarā as a staging ground for repeated campaigns against the Betä Ǝsraʾel of Sǝmen, who in 1585 raided and pillaged Wagarā. In the 17th century, dissension and rebellion in Wagarā persisted during the reign of Susǝnyos. Wagarā had been also one of the regions where the Portuguese Jesuits proselytized: the Jesuits claimed that there were about 100, 000 Catholics in Wagarā and Dämbǝya in 1630. During the 17th and 18th century, Wagarā was a granary for Gondar. Under the mid 20th century, imperial administration, Wagarā was an awrāǧǧā within Bägemdǝr composed of five waradās: Dabat, Ṣägade, Sätit Humära, Wägära and Wälqayt.",
