    "place_types" : "province",
    "details" : "Wallo is an area in central Ethiopia and takes its name from a large Oromo's subgroup that settled in this area from the late 16th cent.. The Oromo of Wallo were further divided into seven main sub-units that lived in different parts of Wallo and have been used until today to designate the major administrative divisions of this area. In spite of being occupied by Oromo, certain parts of Wallo were deeply influenced by the Amhara language and culture and were involved in the Christian monarchy politics, especially during the 18th and 19th century. Other parts of Wallo retained a separate identity and adhered to Islam, undertaking a process of islamization of Wallo in the 18th century. However, from the mid-19th century, the Christian Emperors undertook the re-conquest and Christian conversion of Wallo in name of a political reunification as well as to preserve the egemony of the Christian faith and state. In spite of this, Islam has survived in Wallo where there are important centres of Islamic learning and shrines. In 1917, with the defeat of rās Maḥammad ʾAli , father of Iyasu (V) , Wallo lost its importance and was reduced to a buffer zone to be ruled and taxed for the benefit of Šawān officials. Following these events, the imperial power monitored Wallo carefully an Ḫaylä Śǝllase I regarded it as a potentially insurrectionary area and kept it subjugated with a stong military presence. Following the Italian defeat in 1941, Wallo continued to be looked at with suspicion, was neglected by the central power in the process of modernization and governed by non-local governors. Some of its territories were merged with Šawā and Tǝgrāy. Wallo played a role in the end of the regime of Ḫaylä Śǝllase I : in 1973, it was hit by a dramatic famine which caused scandal and triggered protests that culminated in the Ethiopian Revolution of 1974. Following another severe famine in 1984 and the Darg's policy of forced resettlement, the anti-regime movement operating in Wallo received great support and played an important role in the collapse of the regime in 1991.",
