    "place_types" : [ "area", "kingdom" ],
    "details" : "ʾAmḥarā is the name of a historical area in central Ethiopia. This place-name does not appear in the sources of the Aksumite period and its earlierst preserved mention can be found in a manuscript of the No item: LIT4277GoldenG of Dabra Libānos dating to 1322. These mentions became numerous in Ethiopic medieval sources and increased over time. The importance of this area seems to have increased after the fall of the Zagwe and the re-establishment of the Solomonic dynasty in the late 13th century. ʾAmḥarā is also referred to as a \"kingdom\" in correspondence between Solomonic and Egyptian rulers, in Arabic historiography as well as in Medieval European maps. Different sources give information on the borders and territories of ʾAmḥarā. For instanc Hiob Ludolf's Historia Aethiopica (1681) situates ʾAmḥarā between the rivers ʾAbbāy in the west, Bäšǝlo in the north, Borkänna in the eas and Käsäm in the south. In the pre-17th century Ethiopian empire, ʾAmḥarā was the heart of the empire and the core of the political and religious power, protected by the richer but more heterogeneous and unstable Šawā. From the mid-16th century, ʾAmḥarā started to decline due to invasio, sacking and destruction by ʾAḥmad's forces and Oromo groups as well as to religious and political struggles. The centre of the imperial power moved to the lake Ṭānā and the physiognomy of ʾAmḥarā changed, up to its disintegration in the second half of the 19th century. The territorial concept of historical ʾAmḥarā was not re-utilised in later administrative divisions of Ethiopia: its territories were first included into the province of Walloo and then divided into the Samen Wallo and Dabub Wallo zones.",
