    "place_types" : [ "district", "site", " Postaksumite II" ],
    "details" : "The chronicle of King ʾaṣe Galāwdewoslocates ʾAraftā somewhere inTǝgrāy. According to this chronicle, it was a place where the Christians army became victorious over the Muslims forces with the support of thePortugal soldiers in1542. On the other hand, Miguel de Castanhoso 's account reports the Portuguese army defeated the forces of ʾAḥmadin the same year, as indicated in the chronicle, at a place called Amba Śännayti which is today in the region of ʿAdwa. Amba Śännayti has 70 districts. Therefore, ʾAraftā would probably be a locality in one of the districts ofAmba Śännayti.",
